import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M3 5a1 1 0 000 2h18a1 1 0 100-2H3z", fill: primaryFill }),
        React.createElement("path", { d: "M3 11a1 1 0 100 2h16.25a2 2 0 110 4h-3.84l.3-.3a1 1 0 00-1.42-1.4l-2 2a1 1 0 000 1.4l2 2a1 1 0 001.42-1.4l-.3-.3h3.84a4 4 0 000-8H3z", fill: primaryFill }),
        React.createElement("path", { d: "M2 18a1 1 0 011-1h6a1 1 0 110 2H3a1 1 0 01-1-1z", fill: primaryFill }));
};
const TextWrap24Filled = wrapIcon(rawSvg({}), 'TextWrap24Filled');
export default TextWrap24Filled;
